import React from 'react';
import Nav from 'react-bootstrap/Nav';
import lang from '../lang/en.json';

export default function Navbar() {

  return (
    <div className='nav-container'>
      <div className='nav-logo'>
        adw
      </div>
      <Nav
        activeKey="/home"
        // onSelect={(selectedKey) => alert(`selected ${selectedKey}`)}
      >
        <Nav.Item>
          <Nav.Link href="/home">{lang.home}</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link eventKey="link-1">{lang.skills}</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link eventKey="link-2">{lang.work}</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link eventKey="link-2">{lang.about}</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link eventKey="link-2">{lang.contact}</Nav.Link>
        </Nav.Item>
      </Nav>
    </div>
  );
}
